    def readingFiles(self): # READING TRAJECTORIES INFORMATION FILE
        filename = self.dir+"/10min.txt"
        f = open(filename, 'rU')
        for line in f:
            line = line.replace("[",  "")
            line = line.replace("]",  "")
            line = line.replace(" ",  "")
            line = line.strip()
            temp = line.split(",")
            local = []
            for i in range(len(temp)):
                local.append(int(temp[i]))
            self.trajectories.append(local)
        f.close()
        
